import React from 'react';

import './index.css';

export function Background()
{
    return (
        <div className="container-body">
            <div className="bg-video">
                <video autoplay src="https://www.w3schools.com/html/mov_bbb.mp4"></video>
            </div>
        </div>
    )
}
